	//get first-level genre
	public static void getFirstLevel() throws Exception {
		RakutenIchiba ichiba = new RakutenIchiba();
		
		FileIO.clearFile(path);
		SearchCondition condition = new SearchCondition();
		condition.setKeyword("ポケモン");
		condition.setSort_method("-reviewCount");
		condition.setGenreInformationFlag("1");
		for(int i = 1; i <= 1; i++){
			condition.setPage(String.valueOf(i));
			String jsonString = ichiba.ichibaItemSearch(condition);
//			FileIO.writeIntoFile(path, ichiba.getTitleFromJSON(jsonString));
			FileIO.writeGenres(path, ichiba.getGenreCountFromJSON(jsonString));
			if(i%3 == 1){
				Thread.sleep(800);
			}
		}	
	}
	
	//get second-level genre
	public static void getSecondLevel() throws Exception {
		RakutenIchiba ichiba = new RakutenIchiba();
		FileIO.clearFile(path);
		for(String first_level_genre : first_Level){
			SearchCondition condition = new SearchCondition();
			condition.setKeyword("ポケモン");
			condition.setSort_method("-reviewCount");
			condition.setGenreInformationFlag("1");
			condition.setGenreId(first_level_genre);
			String jsonString = ichiba.ichibaItemSearch(condition);
			FileIO.writeGenres(path, ichiba.getGenreCountFromJSON(jsonString));
			Thread.sleep(500);
		}
	}
	
	//get third-level genre namemap
	public static void getThirdLevelGenreNamemap() throws Exception{
		RakutenIchiba ichiba = new RakutenIchiba();
		HashMap<String, String> namemap = new HashMap<String, String>();
		FileIO.clearFile(path);
		for(String second_level_genre : second_level){
			SearchCondition condition = new SearchCondition();
			condition.setKeyword("ポケモン");
			condition.setSort_method("-reviewCount");
			condition.setGenreInformationFlag("1");
			condition.setGenreId(second_level_genre);
			String jsonString = ichiba.ichibaItemSearch(condition);
			namemap.putAll(ichiba.getGenreMap(jsonString));
			Thread.sleep(500);
		}
		FileIO.writeHashMap(path, namemap);
	}
